import React from "react";
import logo from "./logo.svg";
import "./App.css";
// 중괄호를 두 번 쓰는 이유? 딕셔너리도 자바스크립트니까요!
// 이렇게 쓰거나,
<p style={{ color: "orange", fontSize: "20px" }}>orange</p>;

//혹은 스타일 딕셔너리를 변수로 만들고 쓸 수 있어요!
